window.bookSummaryJSON = "<p><b><i>Read by the author, Tracy Whitwell.</i></b><br> <br> Ever since Tanz discovered she could speak with the dead, life became a whole lot more interesting. But after putting herself in grave danger helping to solve a grisly murder, she’s determined to ignore the voices and put all that nasty business behind her.<br> <br> So when she’s offered another acting gig in her hometown of Newcastle, it feels like a perfect opportunity to spend some time with family and have a laugh with old friends.<br> <br> But the dead won’t stay quiet for long. Soon Tanz is being drawn back into their world, and this time, the danger is much closer to home . . .<br> <br> <b><i>Gin Palace</i></b><b> is the second book in Tracy Whitwell’s hilarious and spookily quirky Accidental Medium series.</b></p>"; 
